            <button> Kijelentkezes</button>
            <h1>{token[1]}</h1>
            <img id="logo" src={require("../kepek/vwlogo.png")} alt="vwlogo.png" />
          </ul>
        </div>
      </div>
    );
  }*/

  
};
export default Navbar;
